import axios from 'axios';

const API_URL = 'http://127.0.0.1:8080'; // Remplacez cela par votre URL API correcte

export const fetchProducts = async () => {
  try {
    const response = await axios.get(API_URL);
    return response.data; // Retourne les données pour utilisation dans les composants
  } catch (error) {
    throw new Error(error.response.data.message || error.message);
  }
};
